css:
.editor .gutter .line-number.coffee-error .icon-right {
  visibility: visible;
}
.editor .gutter .line-number.coffee-error .icon-right:before {
  content: "\f02d";
  color: #cb6077;
}
.editor .gutter .line-number.coffee-warn .icon-right {
  visibility: visible;
}
.editor .gutter .line-number.coffee-warn .icon-right:before {
  content: "\f059";
  color: #d28b71;
}
.coffee-lint {
  display: -webkit-flex;
  -webkit-flex-direction: column;
  min-height: 140px;
}
.coffee-lint .resize-handle {
  position: absolute;
  left: 0;
  right: 0;
  height: 10px;
  cursor: row-resize;
}
.coffee-lint .panel {
  -webkit-flex-grow: 1;
  display: -webkit-flex;
  -webkit-flex-direction: column;
  margin: 0;
}
.coffee-lint .panel .close-icon:before {
  font-family: 'Octicons Regular';
  -webkit-font-smoothing: antialiased;
  width: 12px;
  content: "\f081";
}
.coffee-lint .panel .close-icon:hover {
  color: #e9e1dd;
}
.coffee-lint .panel .background-message {
  padding-top: 20px;
  text-align: center;
}
.coffee-lint .panel .panel-body {
  -webkit-flex-grow: 1;
  padding: 0;
  overflow-y: scroll;
}
.coffee-lint .panel .panel-body .list-item {
  cursor: pointer;
  padding: 0 10px;
}
.coffee-lint .panel .panel-body .list-item:hover {
  background: rgba(255, 255, 255, 0.07);
}
.coffee-lint .panel .panel-body .list-item.lint-error .icon {
  color: rgba(203, 96, 119, 0.7);
}
.coffee-lint .panel .panel-body .list-item.lint-error .icon:hover {
  color: #cb6077;
}
.coffee-lint .panel .panel-body .list-item.lint-warn .icon {
  color: rgba(210, 139, 113, 0.7);
}
.coffee-lint .panel .panel-body .list-item.lint-warn .icon:hover {
  color: #d28b71;
}
